import React, { useState } from 'react';
import MenuElement from './MenuElement.js';
import axios from 'axios';

import './LeftMenu.css';

const LeftMenu = () => {
  const [elements, setElements] = useState(<MenuElement onClick={()=>console.log("x")} val="Empty Element" src="placeholder.jpg" key="empty"/>);

  axios.get('localhost:3001/recipelist')
    .then( (res) => {
      res.map( (r) => <MenuElement onClick={()=>console.log(r.title)} val={r.title} src="placeholder.jpg" key="empty"/>);
    })
  return (
    <div className="menu left">
      <div className="banner">
        Menu
      </div>
      <div className="elements">
        {elements}
      </div>
    </div>
  )
}

export default LeftMenu;
